#include <iostream>
#include <cstdio>
#include <cmath>
using namespace std;
const string isPlanar = "";

int t, n, m;
int main() {
    string data;
    freopen("planaritycheck.in",  "r", stdin);
    freopen("planaritycheck.out", "w", stdout);
    cin >> t;
    getline(cin,data);
    for (int i = 0; i < t; ++i) {
        getline(cin,data);
        m = static_cast<int>(data.size());
        n = static_cast<int>((1 + sqrt(1 + 4 * 2 * m)) / 2);
        if (n <= 4)
            cout << "YES" << endl;
         else if (n == 5)
            cout << (data == "1111111111" ? "NO" : "YES") << endl;
         else {
            int graphNum = 0;
            for (int j = 0; j < m; ++j)
                graphNum += (1 << j)*(data[m - j - 1] - '0');
            cout << (isPlanar[graphNum] == '1' ? "YES" : "NO") << endl;
        }
    }
    return 0;
}